import React from 'react';
import { PieChart, Pie, Cell, ResponsiveContainer } from 'recharts';

const COLORS = ['#22c55e', '#60a5fa'];

const segments = [
  { name: 'كفو الحلال', value: 60, color: COLORS[0] },
  { name: 'النخلة', value: 40, color: COLORS[1] },
];

const totalValue = 456; // K as per design

const renderCalloutLabel = (props) => {
  const { cx, cy, midAngle, outerRadius, index } = props;
  const RAD = Math.PI / 180;
  const offset = 16;
  const r = outerRadius + offset;
  const x = cx + r * Math.cos(-midAngle * RAD);
  const y = cy + r * Math.sin(-midAngle * RAD);

  const seg = segments[index];
  const boxW = 80;
  const boxH = 26;
  const rx = 10;
  const bx = x - boxW / 2;
  const by = y - boxH / 2;

  return (
    <g>
      <filter id="shadow" x="-50%" y="-50%" width="200%" height="200%">
        <feDropShadow dx="0" dy="2" stdDeviation="2" floodColor="#000" floodOpacity="0.15" />
      </filter>
      <rect x={bx} y={by} width={boxW} height={boxH} rx={rx} ry={rx} fill="#fff" stroke="#e5e7eb" filter="url(#shadow)" />
      <text x={bx + 8} y={by + 16} fill="#6b7280" fontSize={12}>{`${seg.name}:`}</text>
      <text x={bx + boxW - 28} y={by + 16} fill="#111827" fontSize={12} fontWeight={700}>{`${seg.value}%`}</text>
    </g>
  );
};

const RevenueChart = () => {
  return (
    <div className="relative" style={{ width: '100%', height: 320 }}>
      <ResponsiveContainer>
        <PieChart>
          <Pie
            data={segments}
            innerRadius={70}
            outerRadius={102}
            paddingAngle={2}
            cornerRadius={10}
            startAngle={90}
            endAngle={-270}
            dataKey="value"
            cx="50%"
            cy="50%"
            labelLine={false}
            label={renderCalloutLabel}
          >
            {segments.map((s) => (
              <Cell key={s.name} fill={s.color} />
            ))}
          </Pie>
        </PieChart>
      </ResponsiveContainer>

      {/* Center metric */}
      <div className="absolute inset-0 flex items-center justify-center pointer-events-none">
        <div className="text-center">
          <div className="text-4xl font-extrabold text-[#1F2757]">{totalValue} K</div>
          <div className="text-xs text-gray-500 mt-1">عدد العملاء</div>
        </div>
      </div>

      {/* Bottom legend */}
      <div className="grid grid-cols-2 gap-6 mt-4 px-4 text-sm" dir="rtl">
        <div className="flex items-center justify-between">
          <span className="text-gray-700">صيدلية كفو الحلال البيطرية</span>
          <span className="inline-block w-3 h-3 rounded-full" style={{ backgroundColor: COLORS[0] }}></span>
        </div>
        <div className="flex items-center justify-between">
          <span className="text-gray-700">صيدلية النخلة</span>
          <span className="inline-block w-3 h-3 rounded-full" style={{ backgroundColor: COLORS[1] }}></span>
        </div>
        <div className="col-span-2 text-gray-700">55.5% &nbsp;&nbsp; 40%</div>
      </div>
    </div>
  );
};

export default RevenueChart;
